  <style>
    :root { --bg:#0f1115; --fg:#e8e8ef; --panel:#ffffff; --ring:#2a2f3a; }
    * { box-sizing: border-box; }
    html, body { height: 100%; }
    body {
      margin: 0;
      font: 16px/1.6 system-ui, -apple-system, Segoe UI, Roboto, Ubuntu, Cantarell, "Helvetica Neue", Arial, "Noto Sans";

      color: var(--fg);
      display: grid;
      place-items: center;

      background: #171a22;
      color: var(--fg);
      border: 1px solid var(--ring);
      padding: 8px 12px;
      border-radius: 10px;
      text-decoration: none;
    }
    .frame {
      background: var(--panel);
      border: 1px solid #e6e8ef;
      border-radius: 14px;
      padding: 12px;
      box-shadow: 0 10px 30px rgba(0,0,0,.35);
    }
    .image-wrap { display: grid; place-items: center; }
    img { display: block; width: 100%; height: auto; }
    footer { opacity: .8; font-size: 14px; margin-top: 10px; text-align: center; }
  </style>
